import React from "react";

const Products = () => {
  return (
    <section>
      <h1>제품 리스트</h1>
      <ul>
        <li>마들렌</li>
        <li>휘낭시에</li>
        <li>까눌레</li>
      </ul>
    </section>
  );
};

export default Products;
